import React, { Component } from "react";
import axios from "axios";
import { Redirect, withRouter } from "react-router-dom";

class DateTest extends Component {
    constructor(props) {
        super(props);

        this.state = {
            datetimes: undefined,
        }
    }



    addDate = (e) => {
        e.preventDefault();
        var monday = new Date();
        monday = monday.getFullYear() + '-' + monday.getMonth() + '-' + (monday.getDate() + 1);

        axios.post('http://localhost:1337/dates/', {
            date: monday,
            time: "17:00:00.000",
            TicketsLeft: 25,
        }).then((rest) => { console.log("yay: " + rest) })
    }


    render() {

        if (this.props.aUserGroup != "admin") {
            return (<Redirect to="/" />)
        }
        return (
            <div>
                <form onSubmit={this.addDate}>
                    <button type="submit" className={"addFormButton"}>Save</button>
                </form>
            </div>
        )
    }
}

export default DateTest;
